import React from 'react'

const SaveChanges = () => {
  return (
    <div className="fixed bottom-0 bg-white w-full flex justify-between px-10 py-10">
      <h1>Vamos a cambiar los camponentes</h1>
      <button
        className="bg-blue-600 text-white px-5 py-2"
      >Save</button>
    </div>
  )
}

export default SaveChanges
